import React,{useState} from 'react'
import './Form.scss'
const Form = () => {
	var [emptyInput,setEmptyInput]=useState()
	function checkLink(e){
		console.log(e)
	}
	return (
		<form>
			<input onBlur={checkLink} type="text" placeholder="Shorten a link here..."/>
			{emptyInput?"aaaaa":""}
			<button>Shorten It!</button>
		</form>
	)
}

export default Form
